data:
  definition: élément d'un ensemble employé conventionnellement pour constituer, représenter
    ou gérer des informations
  examples: []
  notes:
  - Les caractères peuvent être des lettres, des chiffres, des signes de ponctuation
    ou d'autres symboles et, par extension, des commandes de fonction telles que "espace",
    "retour de chariot", ou "à la ligne", utilisées dans un message.
